  <JS_VAL type="javascript" meta=""><![CDATA[getField('BTN_SUBMIT').onclick = function() {
  
  var cantidad = Number_Rows_Grid("GRD_ART_SOL","TXTS_ART");  
  for(var i=1; i<=cantidad; i++){
    var articulo = getGridField("GRD_ART_SOL",i,"TXTS_ART").value;
    var importancia = getGridField("GRD_ART_SOL",i,"TXT_IMP_ART").value;
    var can = getGridField("GRD_ART_SOL",i,"TXT_CANT").value;

    var sol = getGridField("GRD_ART_SOL",i,"TXT_CANT_SOL").value;
    var d_inicio = getGridField("GRD_ART_SOL",i,"DATE_INI").value;
    
    var h_inicio = getGridField("GRD_ART_SOL",i,"DRP_HORA_INI_SOL").selectedIndex;
    var h_inicio_t = getGridField("GRD_ART_SOL",i,"DRP_HORA_INI_SOL").options[h_inicio].text;

    var d_fin = getGridField("GRD_ART_SOL",i,"DATE_DEV").value;

    var h_fin = getGridField("GRD_ART_SOL",i,"DRP_HORA_FIN_SOL").selectedIndex;
    var h_fin_t = getGridField("GRD_ART_SOL",i,"DRP_HORA_FIN_SOL").options[h_fin].text;

  
    
    if( cantidad == 0 && articulo == ""){
       alert("por favor ingrese alguna articulo ha solicitar");
       return false;
    }

    var arHora1 = h_inicio_t.split(":"); 
    var arHora2 = h_fin_t.split(":"); 
     
    // Obtener horas y minutos (hora 1)
    var hh1   = parseInt(arHora1[0],10); 
    var mm1   = parseInt(arHora1[1],10); 

    // Obtener horas y minutos (hora 2) 
    var hh2   = parseInt(arHora2[0],10); 
    var mm2   = parseInt(arHora2[1],10);

    // Comparar 
    if (hh2<hh1 || (hh1==hh2 && mm2<mm1) || (hh1==hh2 && mm2==mm1)){
      alert("La hora de fin del evento debe ser mayor a la hora de inicio.");
      return false;
    }
    //comparar cantidad solicitada    
    if(can<sol){
      alert("Por favor revise su solicitud.");
      return false;
    }
    
 }
  
}]]></JS_VAL>
